import React, { Component } from 'react'
import "./App.css";

export class DyslexiaTest extends Component {
    render() {
        return (
            <div style={testStyle}>
                <h1 style={titleStyle}>Here are some tests</h1>
                <p>The first test is:</p>
            </div>
        )
    }
}

const testStyle = {
    position: 'absolute',
    left: '0', 
    right: '0', 
    bottom: '0',
    background: '#ff4444',
    padding: '3px 8px',
    color: '#fff',
    zIndex: 1
}

const titleStyle = {
    fontFamily: "IkarosL",
    fontSize: '50px',
    color: '#fff',
    textAlign: 'center',
  }

  const pStyle = {
    fontFamily: "IkarosL",
    fontSize: '25px',
    color: '#fff',
    padding: '10px'
  }
export default DyslexiaTest
